script: |
  super -f text -I q10501.spq | sort > q10501.out

inputs:
  - name: q10501.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE NOT col2 BETWEEN col2 AND + - 40 + - - 34 + col2 * - + col2 AND NOT col0 IS NULL;
  - name: tab1

outputs:
  - name: q10501.out
    data: |
      51	14	96
      85	5	59
      91	47	68
